import React from "react";
import { Link } from "react-router-dom";

function Signin() {
  return (
    <div className="Main">
      <div className="main-text">
        <p> 지금 회원가입하시면 </p>
        <p> 명함이 5초만에 뚝딱!</p>
      </div>
      <Link to="/signin" className="main-btn">
        카카오톡으로 회원가입
      </Link>
      <p> 명함이 5초만에 뚝딱!</p>
    </div>
  );
}

export default Signin;
